insert into Measurementcounter ( TYPEID, DATANAME, DESCRIPTION, TIMEAGGREGATION, GROUPAGGREGATION, COUNTAGGREGATION, COLNUMBER, DATATYPE, DATASIZE, DATASCALE, INCLUDESQL, UNIVOBJECT, UNIVCLASS, COUNTERTYPE, COUNTERPROCESS, DATAID, FOLLOWJOHN ) values ( 'DC_E_TEST:((202)):DC_E_TEST_VCLTP_V', 'pmBwUtilizationTx', 'pmBwUtilizationTx: The counter shows the utilization of the virtual connection in the transmitting direction represented by a histogram, consisting of a list of 21 numbers, indexed from zero. The first number is Peak Cell Rate (PCR) and the next 20 numbers are different load ranges (range counters) for the VclTp MO. The load is sampled every 10s and depending on the sampled value, the corresponding range counter is increased. PDF ranges: The number is rounded upwards to the nearest integer. [0]: PCR, [1]: [0..5.0]%, [2]: [>5.0..10.0]%, [3]: [>10.0..15.0]%, [4]: [>15.0..20.0]%, [5]: [>20.0..25.0]%, [6]: [>25.0..30.0]%, [7]: [>30.0..35.0]%, [8]: [>35.0..40.0]%, [9]: [>40.0..45.0]%, [10]: [>45.0..50.0]%, [11]: [>50.0..55.0]%, [12]: [>55.0..60.0]%, [13]: [>60.0..65.0]%, [14]: [>65.0..70.0]%, [15]: [>70.0..75.0]%, [16]: [>75.0..80.0]%, [17]: [>80.0..85.0]%, [18]: [>85.0..90.0]%, [19]: [>90.0..95.0]%, [20]: [>95.0..100]% Condition: Continuous measurement of load during the last measurement period. Counter is reset after measurement period: Yes Counter type: PDF Unit: (for range 0) PCR, (for ranges 1 to 20) % of VC bandwidth ', 'SUM', 'AVG', 'GAUGE', 102, 'numeric', 18, 8, 1, 'pmBwUtilizationTx', '', 'VECTOR', 'VECTOR', 'pmBwUtilizationTx', null );
insert into Measurementcounter ( TYPEID, DATANAME, DESCRIPTION, TIMEAGGREGATION, GROUPAGGREGATION, COUNTAGGREGATION, COLNUMBER, DATATYPE, DATASIZE, DATASCALE, INCLUDESQL, UNIVOBJECT, UNIVCLASS, COUNTERTYPE, COUNTERPROCESS, DATAID, FOLLOWJOHN ) values ( 'DC_E_TEST:((202)):DC_E_TEST_VCLTP_V', 'pmBwUtilizationRx', 'pmBwUtilizationRx: The counter shows the utilization of the virtual connection in the receiving direction represented by a histogram, consisting of a list of 21 numbers. The first number is Peak Cell Rate (PCR) and the next 20 numbers are different load ranges (range counters) for the VclTp MO. The load is sampled every 10s and depending on the sampled value, the corresponding range counter is increased. PDF ranges: The number is rounded upwards to the nearest integer. [0]: PCR, [1]: [0..5.0]%, [2]: [>5.0..10.0]%, [3]: [>10.0..15.0]%, [4]: [>15.0..20.0]%, [5]: [>20.0..25.0]%, [6]: [>25.0..30.0]%, [7]: [>30.0..35.0]%, [8]: [>35.0..40.0]%, [9]: [>40.0..45.0]%, [10]: [>45.0..50.0]%, [11]: [>50.0..55.0]%, [12]: [>55.0..60.0]%, [13]: [>60.0..65.0]%, [14]: [>65.0..70.0]%, [15]: [>70.0..75.0]%, [16]: [>75.0..80.0]%, [17]: [>80.0..85.0]%, [18]: [>85.0..90.0]%, [19]: [>90.0..95.0]%, [20]: [>95.0..100]% Condition: Continuous measurement of load during the last measurement period. Counter is reset after measurement period: Yes Counter type: PDF Unit: (for range 0) PCR, (for ranges 1 to 20) % of VC bandwidth ', 'SUM', 'AVG', 'GAUGE', 101, 'numeric', 18, 8, 1, 'pmBwUtilizationRx', '', 'VECTOR', 'VECTOR', 'pmBwUtilizationRx', null );
